--
-- Name: insert_topics(integer, text[]); Type: PROCEDURE; Schema: public; Owner: matchaadmin
--

CREATE PROCEDURE public.insert_topics(usersid integer, topic_array text[])
    LANGUAGE plpgsql
    AS $$
	declare
            topic_element  text;
	begin
		delete from USERS_TOPIC where users_id = usersid;
		foreach topic_element in array topic_array
		loop
			select topic_element
			 where not exists ( select 1 from TOPIC where tag = topic_element);
		end loop;
	end;
    $$;


ALTER PROCEDURE public.insert_topics(usersid integer, topic_array text[]) OWNER TO matchaadmin;

--
-- Name: on_insert_notification(); Type: FUNCTION; Schema: public; Owner: matchaadmin
--

CREATE FUNCTION public.on_insert_notification() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
  IF TG_OP = 'INSERT' AND new.notif_type IN ('Like', 'Dislike') THEN
  	delete from NOTIFICATION where sender_id = new.sender_id and receiver_id = new.receiver_id and notif_type in ('Like', 'Dislike');
  END IF;
  return new;
end;
$$;


ALTER FUNCTION public.on_insert_notification() OWNER TO matchaadmin;

--
-- Name: on_room_dml(); Type: FUNCTION; Schema: public; Owner: matchaadmin
