CREATE FUNCTION public.on_room_dml() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
begin
  IF TG_OP = 'INSERT' THEN
  ELSIF TG_OP = 'DELETE' THEN
  	delete from USERS_ROOM where room_id = old.id;
  END IF;
  return null;
end;
$$;


